import Form from 'react-bootstrap/Form';

function SwitchExample() {
  return (
    <Form>
      <Switch {...label} defaultChecked />
<Switch {...label} />
<Switch {...label} disabled defaultChecked />
<Switch {...label} disabled />
    </Form>
  );
}

export default SwitchExample;
